  qudt_Datatype:
    class_uri: qudt:Datatype
    conforms_to: No schema conformance document specified
    description: A data type is a definition of a set of values (for example, "all
      integers between 0 and 10"), and the allowable operations on those values; the
      meaning of the data; and the way values of that type can be stored. Some types
      are primitive - built-in to the language, with no visible internal structure
      - e.g. Boolean; others are composite - constructed from one or more other types
      (of either kind) - e.g. lists, arrays, structures, unions. Object-oriented programming
      extends this with classes which encapsulate both the structure of a type and
      the operations that can be performed on it. Some languages provide strong typing,
      others allow implicit type conversion and/or explicit type conversion.
    is_a: qudt_Concept
    name: qudt_Datatype
    source: http://qudt.org/2.1/schema/qudt
    title: QUDT Datatype
  qudt_EnumeratedValue:
    annotations:
      count: 1
    class_uri: qudt:EnumeratedValue
    conforms_to: No schema conformance document specified
    description: "<p>This class is for all enumerated and/or coded values.  For example,\
      \ it contains the dimension objects that are the basis elements in some abstract\
      \ vector space associated with a quantity kind system. Another use is for the\
      \ base dimensions for quantity systems. Each quantity kind system that defines\
      \ a base set has a corresponding ordered enumeration whose elements are the\
      \ dimension objects for the base quantity kinds. The order of the dimensions\
      \ in the enumeration determines the canonical order of the basis elements in\
      \ the corresponding abstract vector space.</p>\r\u240A\r\u240A<p>An enumeration\
      \ is a set of literals from which a single value is selected. Each literal can\
      \ have a tag as an integer within a standard encoding appropriate to the range\
      \ of integer values. Consistency of enumeration types will allow them, and the\
      \ enumerated values, to be referred to unambiguously either through symbolic\
      \ name or encoding. Enumerated values are also controlled vocabularies and as\
      \ such need to be standardized. Without this consistency enumeration literals\
      \ can be stated differently and result in  data conflicts and misinterpretations.</p>\r\
      \u240A\r\u240A<p>The tags are a set of positive whole numbers, not necessarily\
      \ contiguous and having no numerical significance, each corresponding to the\
      \ associated literal identifier. An order attribute can also be given on the\
      \ enumeration elements. An enumeration can itself be a member of an enumeration.\
      \ This allows enumerations to be enumerated in a selection. Enumerations are\
      \ also subclasses of Scalar Datatype. This allows them to be used as the reference\
      \ of a datatype specification.</p>"
    from_schema: https://raw.githubusercontent.com/frink-okn/schema-gen/refs/heads/main/qudt
    is_a: qudt_Verifiable
    name: qudt_EnumeratedValue
    slot_usage:
      dct_description:
        annotations:
          string: 1
      qudt_abbreviation:
        annotations:
          string: 1
      rdfs_label:
        annotations:
          string: 1
    slots:
    - qudt_abbreviation
    - dct_description
    - rdfs_label
    source: http://qudt.org/2.1/schema/qudt
    title: Enumerated Value
  qudt_Enumeration:
    class_uri: qudt:Enumeration
    conforms_to: No schema conformance document specified
    description: "<p>An enumeration is a set of literals from which a single value\
      \ is selected. Each literal can have a tag as an integer within a standard encoding\
      \ appropriate to the range of integer values. Consistency of enumeration types\
      \ will allow them, and the enumerated values, to be referred to unambiguously\
      \ either through symbolic name or encoding. Enumerated values are also controlled\
      \ vocabularies and as such need to be standardized. Without this consistency\
      \ enumeration literals can be stated differently and result in  data conflicts\
      \ and misinterpretations.</p>\r\u240A\r\u240A<p>The tags are a set of positive\
      \ whole numbers, not necessarily contiguous and having no numerical significance,\
      \ each corresponding to the associated literal identifier. An order attribute\
      \ can also be given on the enumeration elements. An enumeration can itself be\
      \ a member of an enumeration. This allows enumerations to be enumerated in a\
      \ selection. Enumerations are also subclasses of <em>Scalar Datatype</em>. This\
      \ allows them to be used as the reference of a datatype specification.</p>"
    is_a: qudt_Concept
    name: qudt_Enumeration
    source: http://qudt.org/2.1/schema/qudt
    title: Enumeration
